export default function Products(){


    const [title, setTitle] = useState([])
    const [id, setId] = useState([])


    useEffect(() => {
        axios
        .get("http://127.0.0.1:8000/api/product/show")
        .then((data) => console.log(data))
        .catch(err => console.error)
    })



    return(
        <>
        <Navbar />
        hello from Products
        </>
    )
}
